import './Rank.scss';
import React from "react";
import ListView from './ListView';

const Box = (props) => {
  const props_name = props.name;

  return(
    <div class={props_name}></div>
  )
}

function Rank() {
  return (
    <div className="Rank">
      <h1>Rank Page</h1>
      <span class="row">
        <div class="fact-box"></div>
        fact
        <div class="conv-box"></div>
        conv
        <div class="false-box"></div>
        false
      </span>


      <ListView />
    </div>
  );
}

export default Rank;
